// ==============================================================

function getFields() {

  var fields = [];

  // Fields.
  for (var i=0; i < getInputRowMeta().size(); ++i) {
    var valueMeta = getInputRowMeta().getValueMeta(i);
    if (!valueMeta.getName().equals("id") && 
        !valueMeta.getName().equals("tuple_id") && 
        !valueMeta.getName().startsWith("cmis_")) {

      field = {
        "key" : valueMeta.getName(),
        "value" : row[i]
      };

      if (valueMeta.getName().toLowerCase().equals("lookup_id")) {
        if (getVariable("is_document_type","").equals("Y")) {
          field["key"] = "document_id";
        }
        else if (getVariable("is_folder_type","").equals("Y")) {
          field["key"] = "folder_id";
        }
        else if (getVariable("is_aspect","").equals("Y")) {
          if (getField("cmis_basetypeid").equals("cmis:document")) {
            field["key"] = "document_id";
          }
          else if (getField("cmis_basetypeid").equals("cmis:folder")) {
            field["key"] = "folder_id";
          }
          else {
            throw new Exception("Field ''cmis_basetypeid'' with value ''" + getField("cmis_basetypeid") + "''.");
          }
        }
      }

      if (valueMeta.getType() == valueMeta.TYPE_STRING && row[i] != null) {
        field["value"] = "''" + row[i] + "''";
      }
      else if (valueMeta.getType() == valueMeta.TYPE_DATE && row[i] != null) {
        var dt = row[i];
        var dtStr = "";
        dtStr += dt.getDate() + "-" + (dt.getMonth()+1) + "-" + (1900+dt.getYear());
        dtStr += "_";
        dtStr += dt.getHours() + ":" + dt.getMinutes() + ":" + dt.getSeconds();
        field["value"] = "to_date(''" + dtStr + "'', ''DD-MM-YYYY'')";
      }

      fields[fields.length] = field;
    }
  }

  return fields;
}

function getField(fieldName) {

  for (var i=0; i < getInputRowMeta().size(); ++i) {
    var valueMeta = getInputRowMeta().getValueMeta(i);
    if (valueMeta.getName().equals(fieldName)) {
      return row[i];
    }
  }

  throw new Exception("Field ''" + fieldName + "'' is mandatory for the transformation.");
}

function createInsertQuery(fields) {

  var query = "";

  query += "INSERT INTO " + getVariable("target_table","") + " (";

  for (var i=0; i < fields.length; ) {
    query += fields[i]["key"];
    if (++i < fields.length) {
      query += ", ";
    }
  }

  query += ") VALUES (";

  for (var i=0; i < fields.length; ) {
    query += fields[i]["value"];
    if (++i < fields.length) {
      query += ", ";
    }
  }

  query += ");";

  return query;
}
